- input: "TEXT\x1CC00351197\x1CSA16.8254.TEXT\x1CSA16.8254\x1CSA16\x1COn June 9, 2008
    we responded to the RFAI from the FEC dated May 7, 2008.  The report requested
    information on two separate transactions.  The purpose of this memo is to inform
    the FEC of additional information we have obtained.   The second request on the
    RFAI noted an apparent excessive contribution triggered by a contribution to Simpson
    for Congress on 2/28/2008 in the amount of $5000 for the primary election.  We
    reported that the contribution appears to be an excessive contribution to the
    candidate because the PAC's affiliated PAC, the Society of Interventional Pain
    Management Surgery Centers PAC (SIPMSC PAC), made a contribution to the campaign
    on 3/12/2007 in the amount of $1000 for the 'primary' election.  We further reported
    that the check was never received by the Simpson campaign and that the contribution
    may never have been made and was inaccurately reported.  After more investigation
    and speaking with the Simpson campaign, it appears the campaign deposited the
    check into the wrong account.  This explains why the contribution was not reported
    on the campaign committee's FEC report.  In response to this oversight, the campaign
    issued a refund check in the amount of $1000 to the ASIPP PAC on July 25, 2008."
