      memo is to inform the FEC of additional information we have obtained.   The
      second request on the RFAI noted an apparent excessive contribution triggered
      by a contribution to Simpson for Congress on 2/28/2008 in the amount of $5000
      for the primary election.  We reported that the contribution appears to be an
      excessive contribution to the candidate because the PAC's affiliated PAC, the
      Society of Interventional Pain Management Surgery Centers PAC (SIPMSC PAC),
      made a contribution to the campaign on 3/12/2007 in the amount of $1000 for
      the 'primary' election.  We further reported that the check was never received
